/**
 *  PlasmaSdServiceTheme.OnLight
 */
@Composable
public fun PlasmaSdServiceTheme.OnLight(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable () -> Unit,
) {
    val colors = if (isDark) {
        darkOnLightColors
    } else {
        lightOnLightColors
    }
    val gradients = if (isDark) {
        darkOnLightGradients
    } else {
        lightOnLightGradients
    }
    PlasmaSdServiceTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
